import './App.css';
import Title from './Title/Title';

function App() {
    return ( 
        <div className = "App" >
            <div className = "container" >
                <h1 className = "display-4" > hello everyone < /h1>   
                <Title name='lancer' email='angan.o24@gmail.com'/ >
                <br/>
                <Title name='abir' email='lancer.abir@gmail.com' age="29"/ >
            </div > 
        </div>
    );
}

export default App;
